def get_change_dict(position, previous):

    actual = (previous if previous else 41) - position
    amount = abs(actual)
    if actual > 0:
        direction = "up"
    elif actual < 0:
        direction = "down"
    else:
        direction = "none"

    return dict(direction=direction, actual=actual, amount=amount)

