def calculate_plane_point(plane, point):


    a, b, c, d = plane
    x, y, z = point

    if x is None:
        x = -(b*y + c*z + d) / a
    elif y is None:
        y = -(a*x + c*z + d) / b
    elif z is None:
        z = -(a*x + b*y + d) / c

    return [x, y, z]

def Concrete04Funct(fc, discretized_eps, ec, Ec):

    x = discretized_eps/ec
    r = Ec / (Ec - fc/ec)
    return fc*x*r / (r-1+x**r)

