def validate(compression):

    if not compression:
        return None

    if compression == b'\0\0\0\0':
        return None

    if isinstance(compression, bytes):
        compression = compression.decode('ascii')

    if compression not in ('zlib', 'bzp2'):
        raise ValueError(
