def binary_search(collection, search_value):

    first = 0
    last = len(collection) - 1

    while first <= last:
        mid = first + ((last - first) // 2)

        if collection[mid] == search_value:
            return mid
        elif collection[mid] < search_value:
            first = mid + 1
        else:
            last = mid - 1

    return -1

