import torch

def _eye_like(M, device=None, dtype=None):

    assert(len(M.shape) in [2,3])
    assert(M.shape[-1]==M.shape[-2])
    n = M.shape[-1]
    if device is None:
        device = M.device
    if dtype is None:
        dtype = M.dtype
    eye = torch.eye(M.shape[-1], device=device, dtype=dtype) 
