    def test_single_node(self):
        root = _create_node(1)
        assert postorder_traversal_iterative(root) == [1]

    def test_binary_tree(self):
        root = _create_node(1)
        root.left = _create_node(2)
        root.right = _create_node(3)
        assert postorder_traversal_iterative(root) == [2, 3, 1]

