def calculate_delta(df, kpi, period="annual"):

    latest = 0
    if period == "annual":
        previous = 1
    elif period == "quarterly":
        previous = 4
    growth_rate = (
        (df.iloc[latest][kpi] - df.iloc[previous][kpi]) /
        df.iloc[previous][kpi]) * 100.0

    return growth_rate

