def gradientDeterminant(reach_list, y, w):


    # Get reachabilities of the previous, current and the next point
    x_r = reach_list[y - 1]
    y_r = reach_list[y]
    z_r = reach_list[y + 1]

    return w*(y_r-x_r) - w*(z_r-y_r)

