def factorial(n):
    # Base case: factorial of 0 or 1 is always 1
    if n == 0 or n == 1:
        return 1

    # Recursive case: calculate factorial using recursion
    if n < 0:
        # if n is negative, return None
        return None
    else:
        return n * factorial(n-1)

