def calculate_median(nums):
    if len(nums) == 0:
        raise Exception("List is empty")
    else:
        sorted_nums = sorted(nums)
        length = len(sorted_nums)
        middle = length // 2
        if length % 2 == 0:
            return (sorted_nums[middle - 1] + sorted_nums[middle]) / 2
        else:
            return sorted_nums[middle]

